                    </div>
                    <div className="input-group-append ingredient-remove-wrapper">
                        <button className="btn btn-outline-secondary ingredient-remove" type="button">-</button>
                    </div>
                </div>

                <label id="cooking-instructions-label">Cooking Instructions</label>
                <div className="input-group mb-3 instructions-wrapper">
                    <input type="text" name="instructions" className="form-control cooking-instruction" placeholder="Type an instruction" aria-label="Cooking instruction" aria-describedby="basic-addon2"/>
                    <div className="input-group-append instruction-add-wrapper">
                        <button className="btn btn-outline-secondary instruction-add" type="button">+</button>
                    </div>
                    <div className="input-group-append instruction-remove-wrapper">
                        <button className="btn btn-outline-secondary instruction-remove" type="button">-</button>
                    </div>
                </div>

                <input type="submit" value="Submit Recipe" id="submit-button"/>
            </form>
        </Default>
    )
  }
}

class InputForm extends React.Component{
    render(){
        let propName = this.props.name.toLowerCase();
        return(
            <React.Fragment>
                <label id={propName + '-label'}>Ingredients</label>
                <div className={'input-group mb-3 ' + propName + '-wrapper'}>
                    <input type="text" name={propName} className="form-control" placeholder={'Type an ' + propName} aria-label={propName} aria-describedby="basic-addon2"/>
                    <div className={'input-group-append ' + propName + '-add-wrapper'}>
                        <button className={'btn btn-outline-secondary ' + propName + '-add'} type="button">+</button>
                    </div>
                    <div className="input-group-append ingredient-remove-wrapper">
                        <button className={'btn btn-outline-secondary ' + propName + '-remove'} type="button">-</button>
                    </div>
                </div>
            </React.Fragment>
        )
    }
}

class TextArea extends React.Component{
    render(){
        let propName = this.props.name.toLowerCase();
        let rows;
        this.props.rows ? rows = this.props.rows : rows = 1;
        return (
            <React.Fragment>
                <label id={propName + '-label'}>{this.props.name}</label>
                <div className="form-group">
                    <textarea name={propName} className="form-control" id={propName} rows={rows}></textarea>
                </div>
            </React.Fragment>
        )
    }
}

module.exports = NewRecipe;

